import React, { useState, useEffect } from "react";
import {useHistory, useParams} from 'react-router-dom'
import Nav from "../nav/nav"
import '../../style.css';

import { Container, Row, Col } from 'reactstrap';


const ViewResume = () => {

    const [resumeData, setResumeData] = useState([]);

    // const history = useHistory();

    // const resumeInfo = {
    //     patientID:id, 
    //     careproviderID: careprovider
    // }

    // const resumeInfoEdit = {
    //     patientID:id, 
    //     patientEditID: patientEdit
    // }


  useEffect(() => {

    async function fetchData() {
      const res = await fetch(`http://localhost:4000/resume`);
      res.json().then((res) => setResumeData(res));

    }
    fetchData();
  });

//   // Go Back function
//   const goBack = () => {
//     history.goBack()
// }

  return (
    <Container>
      <Nav />
        <h2 className="work-h2">My Work Experience</h2>
        <Row>
          <Col lg="6">
            {resumeData.map((data) =>
              <section className="resume">
                <div className="work-div">
                    <h3>{data.job}</h3>
                    <h4>{data.jobTitle}</h4>
                    <h5>{data.date}</h5>
                    <ul>
                        <li>{data.note1}</li>
                        <li>{data.note2}</li>
                        <li>{data.note3}</li>
                        <li>{data.note4}</li>
                    </ul>
                </div>
                <hr className="work-seperation" />
              </section>
                )}
            </Col>
          </Row>
    </Container>
  );
};

export default ViewResume;
